	;GRAVITY VARIABLES FOR BALL
	Gravity               equ              1                                                                                                                                                                                                     	;gravity acceleration
	FractionDecreaseSpeed equ              2                                                                                                                                                                                                     	;speed loss due to faction between ball and walls
	FractionIncreaseSpeed equ              1
