.CODE
MAIN PROC FAR

	                                  mov                   ax, @data
	                                  mov                   DS, ax

	;-------------------------------- main screen for the two players

	                                  main_screen           username1_buffer, username1, actual_size1, name_message, enter_key, error_message, p1, 7
	                                  main_screen           username2_buffer, username2, actual_size2, name_message, enter_key, error_message, p2, 9

	;-------------------------------- program functionalities screen
                
	functionalites:                   clear_screen
	                                  call                  program_functionalities

	;-------------------------------- wait for a key in the functionalities screen
	key_specify_action:               mov                   ah,1
	                                  int                   16h
	                                  jz                    key_specify_action                                                                      	;check if a key is pressed

	                                  mov                   ah,0
	                                  int                   16h                                                                                     	;get the key

	                                  cmp                   ah,1
	                                  jz                    end_                                                                                    	;if the key is ESC

	                                  cmp                   ah,3ch
	                                  jz                    play_game                                                                               	;if the key is F2

	                                  cmp                   ah,3bh
	                                  jz                    end_                                                                                    	;if the key is F1 (for chatting) 'This will be changed in the next phase'

	                                  jmp                   key_specify_action

	end_:                             jmp                   end_program                                                                             	;this is because the program can't jump directly
	
	play_game:                        mov                   ax, 4F02h
	                                  mov                   bx, 0100h                                                                               	; 640x400 screen graphics mode
	                                  int                   10h                                                                                     	;execute the configuration
	
	;-------------------------------- to print the game's logo
	                                  mov                   ax,EXTRA_DATA1
	                                  mov                   DS,ax
	                                  assume                DS:EXTRA_DATA1
	                                  call                  DRAW_START_LOGO

	                                  mov                   ax,EXTRA_DATA2
	                                  mov                   DS,ax
	                                  assume                DS:EXTRA_DATA2
	                                  call                  DRAW_SOCCER
									  
	;-------------------------------- use the normal data segment
	                                  mov                   ax,@data
	                                  mov                   ds,ax
	                                  assume                DS:@DATA

	;-------------------------------- print 'PRESS 1 FOR LEVEL 1 OR PRESS 2 FOR LEVEL 2'
	                                  move_cursor           12h, 18h
	                                  mov                   dx,offset LEVEL_MESSAGE
	                                  mov                   ah,9
	                                  int                   21h
                              

	wait_key:                         mov                   ah,1
	                                  int                   16h
	                                  jz                    wait_key

	                                  CMP                   AL ,'1'
	                                  JE                    SET_LEVEL1
	                                  CMP                   AL , '2'
	                                  JE                    SET_LEVEL2
	                                  JNE                   wait_key
	SET_LEVEL1:                       
	                                  MOV                   LEVEL_STATUS ,1
	                                  JMP                   AFTER_KEY
	SET_LEVEL2:                       
	                                  MOV                   LEVEL_STATUS,2

	AFTER_KEY:                        
	;-------------------------------- get the key because if the user pressed on F4, the game will not exit
	                                  mov                   ah,0
	                                  int                   16h
	;---------------------------------------------SET_LEVEL_VALUES-----------------------------------------------------------------------------------------------------------------------------------------------
	                                  CMP                   LEVEL_STATUS ,1                                                                         	;CHECK IF WE ARE IN LEVEL 1
	                                  JE                    LEVEL_1
	                                  CMP                   LEVEL_STATUS,2
	                                  JE                    LEVEL_2
									  

	LEVEL_1:                          
	                                  MOV                   BX       ,Player1W_level1
	                                  MOV                   PLAYER1W , BX
	                                  MOV                   BX       ,Player1H_level1
	                                  MOV                   PLAYER1H , BX
	                                  MOV                   BX ,Player1X_level1
	                                  MOV                   Player1X , BX
	                                  MOV                   BX ,Player1Y_level1
	                                  MOV                   PLAYER1Y , BX

	                                  MOV                   BX ,Player2W_level1
	                                  MOV                   PLAYER2W , BX
	                                  MOV                   BX ,Player2H_level1
	                                  MOV                   PLAYER2H , BX
	                                  MOV                   BX ,Player2X_level1
	                                  MOV                   Player2X , BX
	                                  MOV                   BX ,Player2Y_level1
	                                  MOV                   PLAYER2Y , BX
									  
	                                  MOV                   BX ,GravityLine_level1
	                                  MOV                   GravityLine,BX
	                                  MOV                   BX ,LandLine_level1
	                                  MOV                   LandLine , BX

	                                  JMP                   GAME_
	                            
	LEVEL_2:                          
	                                  MOV                   BX ,Player1W_level2
	                                  MOV                   PLAYER1W , BX
	                                  MOV                   BX ,Player1H_level2
	                                  MOV                   PLAYER1H , BX
	                                  MOV                   BX ,Player1X_level2
	                                  MOV                   Player1X , BX
	                                  MOV                   BX ,Player1Y_level2
	                                  MOV                   PLAYER1Y , BX
									  
	                                  MOV                   BX ,Player2W_level2
	                                  MOV                   PLAYER2W , BX
	                                  MOV                   BX ,Player2H_level2
	                                  MOV                   PLAYER2H , BX
	                                  MOV                   BX ,Player2X_level2
	                                  MOV                   Player2X , BX
	                                  MOV                   BX ,Player2Y_level2
	                                  MOV                   PLAYER2Y , BX

	                                  MOV                   BX ,GravityLine_level2
	                                  MOV                   GravityLine,BX
	                                  MOV                   BX ,LandLine_level2
	                                  MOV                   LandLine , BX
	;-------------------------------- change mode to graphics mode to clear the screen
	GAME_:                            mov                   ax, 4F02h
	                                  mov                   bx, 0100h                                                                               	; 640x400 screen graphics mode
	                                  int                   10h
									  

	                                  call                  score_bar
	                                  call                  print_game_strings
	                                  call                  print_player1_score
	                                  call                  print_player2_score
	                                  

	                                  call                  BackGround
	                                  call                  DrawingBall
	                                  call                  drawGoalKeepers
	                                  call                  DRAWE_PLAYER1
	                                  call                  DRAWE_PLAYER2
	                                  call                  delay
	                                 
	;-------------------------------- GAME MAIN LOOP (INFINITE LOOP UNTILL THE PLAYER PRESS F4)
	GameProcess:                      call                  CheckKeyPressed

	;-------------------------------- check if the user pressed on F4
	                                  cmp                   si,-1
	                                  jnz                   continue_game
	                                  call                  new_game

	;-------------------------------- change the mode to text mode to go back to the functionalities screen
	                                  mov                   ah,0
	                                  mov                   al,3
	                                  int                   10h
	                                  jmp                   functionalites
	;-------------------------------------------------------------------------

	continue_game:                    
	                                  call                  PlayerGravity
	                                  call                  PlayerFall
	                                  call                  REFREASH_SCREEN_PART
	                                  call                  DRAWE_PLAYER1
	                                  call                  DRAWE_PLAYER2
	                                  call                  DrawingBall
	                                  call                  delay
	                                  call                  CheckBallCollisionWithScreen
	                                  call                  CheckBallCollisionWithPlayers
	                                  call                  UpdateBallPosition
	                                  call                  CheckIfBallInsideNet
	                                  jmp                   GameProcess


	end_program:                      mov                   ah,4ch
	                                  int                   21h
            
MAIN ENDP
