DrawingBall PROC
	                                  mov                   dx,BallY
	                                  mov                   cx,BallX
	                                  mov                   si,offset BallColor                                                                     	;intialize the position & carry
	DrawRow:                          

	                                  mov                   al,[si]                                                                                 	;mov current color
	                                  mov                   ah,0ch
	                                  cmp                   al ,44
	                                  jZ                    NODROW
	                                  int                   10h                                                                                     	;draw pixed mode

	NODROW:                           inc                   cx
	                                  inc                   si
	                                  mov                   di,BallX
	                                  add                   di,BallW
	                                  cmp                   cx,di                                                                                   	;check end of current row
	                                  jNE                   DrawRow

	                                  mov                   cx,BallX
	                                  inc                   dx
	                                  mov                   di,BallY
	                                  add                   di,BallH
	                                  cmp                   dx,di
	                                  JNE                   DrawRow                                                                                 	;check end of all rows

	                                  ret
DrawingBall ENDP
