BackGround proc

	                                  mov                   di,196

	                                  mov                   dx,0
	                                  mov                   al,7
	                                  mov                   ah,0ch
	                                  mov                   bh,0
	again:                            mov                   cx,0
	back:                             int                   10h
	                                  inc                   cx
	                                  cmp                   cx,640
	                                  jnz                   back
	                                  inc                   dx
	                                  cmp                   dx,di
	                                  jnz                   again


	                                  add                   di,4
	                                  mov                   al,0
	again1:                           mov                   cx,0
	back1:                            int                   10h
	                                  inc                   cx
	                                  cmp                   cx,640
	                                  jnz                   back1
	                                  inc                   dx
	                                  cmp                   dx,di
	                                  jnz                   again1

	                                  add                   di,80
	                                  mov                   al,2
	again2:                           mov                   cx,0
	back2:                            int                   10h
	                                  inc                   cx
	                                  cmp                   cx,640
	                                  jnz                   back2
	                                  inc                   dx
	                                  cmp                   dx,di
	                                  jnz                   again2

	                                  ret

