	                                  Call                  drawGoalKeepers
	                                  call                  DRAWE_PLAYER1
	                                  call                  DRAWE_PLAYER2
	                                  call                  DRAW_PLAYER2_WINS
	                                  call                  delay
	                                  call                  FREAZE_FOR_GOAL
	                                  call                  PutElementsInIntialPosition
	                                  call                  new_game
	                                  jmp                   BallIsnotInsideRightNet





	BallIsnotInsideLeftNet:           

	; check if ball inside the right net
	                                  mov                   Ax,BallX
	                                  mov                   Bx ,GoalKeeperRightX
	                                  cmp                   Ax,Bx
	                                  JL                    BallIsnotInsideRightNet

	                                  mov                   Ax,BallY
	                                  cmp                   Ax,GoalKeeperRightY
	                                  JL                    BallIsnotInsideRightNet

	                                  inc                   player1_score
	                                  call                  print_player1_score
	                                  call                  GOOAL
	                                  call                  FREAZE_FOR_GOAL

	                                  cmp                   player1_score, MAX_GOAL_IN_level1
	                                  je                    PLAYER1_WINNER
	                                  call                  PutElementsInIntialPosition
	                                  jmp                   BallIsnotInsideRightNet


	PLAYER1_WINNER:                   
	                                  call                  BackGround
	                                  call                  DrawingBall
	                                  Call                  drawGoalKeepers
	                                  call                  DRAWE_PLAYER1
	                                  call                  DRAWE_PLAYER2
	                                  call                  DRAW_PLAYER1_WINS
	                                  call                  delay
	                                  call                  FREAZE_FOR_GOAL
	                                  call                  PutElementsInIntialPosition
	                                  call                  new_game

	BallIsnotInsideRightNet:          
	                                 

	                                  ret
CheckIfBallInsideNet ENDP

	;description
PutElementsInIntialPosition PROC
	                                  mov                   BallX,285
	                                  mov                   BallY,160
	                                  mov                   BallSpeedX,0
	                                  mov                   BallSpeedY,0
	                                  CMP                   LEVEL_STATUS,1
	                                  JE                    INIT_LEVEL1
	                                  JMP                   INIT_LEVEL2

	INIT_LEVEL1:                      MOV                   BX ,Player1X_level1
	                                  mov                   Player1X,BX
	                                  MOV                   BX ,Player1Y_level1
	                                  mov                   Player1Y,BX
	                                  MOV                   BX,Player2X_level1
	                                  mov                   Player2X,BX
	                                  MOV                   BX ,Player2Y_level1
	                                  mov                   Player2Y,BX
	                                  JMP                   FINAL_INIT
	INIT_LEVEL2:                      
	                                  MOV                   BX ,Player1X_level2
	                                  mov                   Player1X,BX
	                                  MOV                   BX ,Player1Y_level2
	                                  mov                   Player1Y,BX
	                                  MOV                   BX ,Player2X_level2
	                                  mov                   Player2X,BX
	                                  MOV                   BX ,Player2Y_level2
	                                  mov                   Player2Y,BX

	                                 
	FINAL_INIT:                       mov                   Player1FallStatus,0
	                                  mov                   Player2FallStatus,0
	                                  call                  BackGround
	                                  call                  DrawingBall
	                                  Call                  drawGoalKeepers
	                                  call                  delay

	                                  ret
PutElementsInIntialPosition ENDP

new_game proc
	;------------------------------------ This proc initializes the parameters of the game after ending the game
	                                  mov                   player1_score,0
	                                  mov                   player2_score,0

	                                  cmp                   LEVEL_STATUS,1
	                                  JE                    GAME_LEVEL_1
	                                  JMP                   GAME_LEVEL_2

	GAME_LEVEL_1:                     MOV                   BX , Player1X_level1
	                                  mov                   Player1X,BX
	                                  MOV                   BX ,Player1Y_level1
	                                  mov                   Player1Y,BX
	                                  MOV                   BX ,Player2X_level1
	                                  mov                   Player2X,BX
	                                  MOV                   BX ,Player2Y_level1
	                                  mov                   Player2Y,BX
	                                  JMP                   NEXT_INI
									  
	GAME_LEVEL_2:                     MOV                   BX ,Player1X_level2
	                                  mov                   Player1X,BX
	                                  MOV                   BX ,Player1Y_level2
	                                  mov                   Player1Y,BX
	                                  MOV                   BX ,Player2X_level2
	                                  mov                   Player2X,BX
	                                  MOV                   BX , Player2Y_level2
	                                  mov                   Player2Y,BX
	                                  JMP                   NEXT_INI

	NEXT_INI:                         mov                   BallX  ,285
	                                  mov                   BallY  , 160
	                                  mov                   BallSpeedX,0
	                                  mov                   BallSpeedY,1
	                                  call                  print_player1_score
	                                  call                  print_player2_score
									  
	                               

	                                  ret
new_game endp

FREAZE_FOR_GOAL PROC
	                                  mov                   di ,0FFFFh
	pass1:                            mov                   cx , 2000
	pass2:                            LOOP                  pass2
	                                  DEC                   DI
	                                  JNZ                   pass1
	                                  ret


FREAZE_FOR_GOAL ENDP

